function billingApp() {
    return {

        /* ============================================================
         * 1) DATOS I—N—T—E—G—R—A—D—O—S
         * ============================================================ */
        // Datos precio/horas
        startTime: "",
        endTime: "",
        serviceType: "",
        tanda: "",
        paymentType: "",
        dayWeek: "",
        totalHours: 0,

        // Facturación
        products: [],
        discount: 0,
        form: {
            description: '',
            quantity: 1,
            price: 0,
        },


        /* ============================================================
         * 2) TARIFAS
         * ============================================================ */
        tarifas: {
            "Guarderia": {
                "Inscripcion": 4000,
                "Mensualidad": {
                    "Completa": 10000,
                    "Matutina": 5000,
                    "Vespertina": 5000,
                    "Especial": "DINAMICA"
                }
            },
            "Sala de Tareas": {
                "Inscripcion": 1500,
                "Mensualidad": {
                    "Completa": 2500,
                    "Matutina": 2500,
                    "Vespertina": 2500
                }
            }
        },


        /* ============================================================
         * 3) INIT + WATCHERS
         * ============================================================ */
        init() {
            // recalcula todo cuando algo cambia
            this.$watch('startTime', () => this.updateAll());
            this.$watch('endTime', () => this.updateAll());
            this.$watch('serviceType', () => this.updateAll());
            this.$watch('tanda', () => this.updateAll());
            this.$watch('paymentType', () => this.updateAll());
            this.$watch('dayWeek', () => this.updateAll());
        },


        /* ============================================================
         * 4) LÓGICA: HORAS Y PRECIOS
         * ============================================================ */
        updateAll() {
            this.totalHours = this.calcularTotalHoras(this.startTime, this.endTime);
            this.form.price = this.calcularPrecio();
        },

        toDecimal(timeString) {
            if (!timeString || !timeString.includes(":")) return null;
            const [hourStr, minutePart] = timeString.split(":");
            const hour = parseInt(hourStr, 10);
            const minute = parseInt(minutePart, 10);
            if (isNaN(hour) || isNaN(minute)) return null;

            const isPM = minutePart.includes("PM");
            const isAM = minutePart.includes("AM");

            let h = hour;
            if (isPM && h !== 12) h += 12;
            if (isAM && h === 12) h = 0;

            return h + minute / 60;
        },

        calcularTotalHoras(start, end) {
            const ini = this.toDecimal(start);
            const fin = this.toDecimal(end);

            if (ini === null || fin === null) return 0;

            let total = fin - ini;
            if (total < 0) total += 24;

            return parseFloat(total.toFixed(2));
        },

        calcularHoraSemana(dias) {
            const d = parseInt(dias, 10);
            if (isNaN(d) || d < 1 || d > 5) return 0;
            return (d <= 3) ? 300 * d : 200 * d;
        },

        calcularPrecio() {
            const tabla = this.tarifas[this.serviceType];
            if (!tabla || !this.paymentType) return 0;

            if (this.paymentType === "Inscripcion") {
                return tabla["Inscripcion"] || 0;
            }

            const mensualidad = tabla["Mensualidad"];
            if (!mensualidad) return 0;

            if (this.tanda === "Especial" && this.serviceType === "Guarderia") {
                const horaSemana = this.calcularHoraSemana(this.dayWeek);
                return horaSemana * this.totalHours;
            }

            return mensualidad[this.tanda] ?? 0;
        },


        /* ============================================================
         * 5) FACTURACIÓN: LISTA DE PRODUCTOS
         * ============================================================ */
        format(num) {
            return Number(num || 0).toLocaleString('es-DO', {
                minimumFractionDigits: 2
            });
        },

        addProduct() {
            const select = this.$refs.serviceSelect;
            if (!select.value) {
                alert('Selecciona un servicio antes de guardar.');
                return;
            }

            const subtotal = this.form.quantity * this.form.price

            this.products.push({
                description: select.value,
                quantity: this.form.quantity,
                price: this.form.price,
                subtotal: parseFloat(subtotal.toFixed(2))
            });

            // Reset form
        },

        removeProduct(index) {
            this.products.splice(index, 1);
        },

        get subtotal() {
            return this.products.reduce((sum, p) => sum + p.subtotal, 0).toFixed(2);
        },
        get discountLabel() {
            return this.discount + '%';
        },
        get total() {
            return (parseFloat(this.subtotal) * (1 - this.discount / 100)).toFixed(2);
        },
        /* ============================================================
         * 6) GENERAR PDF
         * ============================================================ */
        generatePDF() {
            return new Promise((resolve, reject) => {
                const { jsPDF } = window.jspdf;
                const doc = new jsPDF({
                    unit: 'mm',
                    format: [241, 342],
                    orientation: 'portrait'
                });

                doc.addFileToVFS("Aptos-Regular.ttf", "");
                doc.addFont("Aptos-Regular.ttf", "Aptos", "normal");
                doc.addFileToVFS("Aptos-Bold.ttf", "");
                doc.addFont("Aptos-Bold.ttf", "Aptos", "bold");

                const date = new Date();
                let dateLong = date.toLocaleDateString('es-ES', {
                    day: '2-digit',
                    month: 'short',
                    year: 'numeric'
                });

                dateLong = dateLong.replace('.', '');
                dateLong = dateLong.replace(/ ([a-zñ]+)/, (m) => ' ' + m.trim().charAt(0).toUpperCase() + m.trim().slice(1));
                dateLong = dateLong.replace(/ /g, '-');

                const receiptNo = document.getElementById('receiptNo')?.value || '';
                const tutorName = document.getElementById('tutorName')?.value || '';
                const infantName = document.getElementById('infantName')?.value || '';

                // Agregar plantilla PNG de fondo
                const img = new Image();
                img.src = '/src/includes/invoice/invoice-pay-1.png';
                img.onload = () => {
                    doc.addImage(img, 'PNG', 0, 0, 241, 342);

                    doc.setFont("Aptos", "normal");
                    doc.setFontSize(9);
                    doc.text(receiptNo, 153, 115);
                    doc.text(dateLong, 153, 120.4);
                    doc.text(this.serviceType, 153, 125.4);
                    doc.text(this.tanda, 153, 131);

                    doc.setFontSize(12);
                    doc.text(tutorName, 75, 137);
                    doc.text(infantName, 75, 148);

                    // Detalles de productos/servicios
                    let startY = 168;
                    doc.setFontSize(9);
                    this.products.forEach(p => {
                        doc.text('Pago de ' + p.description, 75, startY);
                        doc.text(p.quantity.toString(), 120, startY);
                        doc.text('RD$ ' + this.format(p.price), 128, startY);
                        doc.text('RD$ ' + this.format(p.subtotal), 154, startY);
                        startY += 5;
                    });

                    // Totales
                    doc.setFontSize(9);
                    const colX = 175;
                    doc.text('RD$ ' + this.format(this.subtotal), colX, 200, { align: 'right' });
                    doc.text(this.discountLabel, colX, 204, { align: 'right' });
                    doc.setFont("Aptos", "bold");
                    doc.text('RD$ ' + this.format(this.total), colX, 208, { align: 'right' });

                    doc.setFont("Aptos", "normal");
                    doc.setFontSize(9);
                    if (this.dayWeek && this.startTime && this.endTime && this.totalHours) {
                        doc.text(this.dayWeek + ' Días a la Semana Desde:(' + this.startTime + ') - Hasta:(' + this.endTime + ') - ' + this.totalHours + ' Horas al Día.', 75, 222);
                    }
                    // Crear blob para iframe
                    const pdfBlob = doc.output('blob');
                    resolve(pdfBlob);
                };
                img.onerror = reject;
            });
        },
        /* ============================================================
         * 7) VIEW PDF
        * ============================================================ */
        async viewPDF() {
            const pdfBlob = await this.generatePDF();
            this.pdfUrl = URL.createObjectURL(pdfBlob);
            this.isInvoiceModal = true;

        },
        /* ============================================================
         * 8) SAVE OR SEND PDF
        * ============================================================ */
        async savePDF(e) {
            e.preventDefault();

            try {
                const pdfBlob = await this.generatePDF();

                const reader = new FileReader();
                reader.readAsDataURL(pdfBlob);

                reader.onloadend = () => {
                    document.getElementById("pdfBase64").value = reader.result.split(",")[1];
                    document.getElementById("invoiceForm").submit();
                };

            } catch (err) {
                console.error("Error generando PDF:", err);
            }
        }

    }
}